func ClearSessionHandler(response http.ResponseWriter, request *http.Request) {
	clearSession(response)
	http.Redirect(response, request, "/", 302)
}

func clearSession(response http.ResponseWriter) {
	cookie := &http.Cookie{
		Name:   "webauthn-session",
		Value:  "",
		Path:   "/",
		MaxAge: -1,
	}
	http.SetCookie(response, cookie)
}

func Upload(w http.ResponseWriter, r *http.Request) {
	// baca file
	r.ParseMultipartForm(0) // sesuain limitnya
	file, _, err := r.FormFile("ocrImage")
	if err != nil {
		panic(err)
	}
	defer file.Close()

	// compose payload
	payload := &bytes.Buffer{}
	writer := multipart.NewWriter(payload)
	files, err := writer.CreateFormFile("ocrImage", "test-ktp-encode-ocrImage.png")
	if err != nil {
		fmt.Println("Error", err)
		jsonResponse(w, http.StatusText(http.StatusBadRequest), http.StatusBadRequest)
		return
	}

	_, err = io.Copy(files, file)
	if err != nil {
		fmt.Println("Error", err)
		jsonResponse(w, http.StatusText(http.StatusBadRequest), http.StatusBadRequest)
		return
	}

	defer func() {
		err = writer.Close()
		if err != nil {
			fmt.Println("Error", err)
		}
		fmt.Println("HERE", "DEFER", err)
	}()

	// err = writer.Close()
	// if err != nil {
	// 	fmt.Println("Error", err)
	// 	jsonResponse(w, http.StatusText(http.StatusBadRequest), http.StatusBadRequest)
	// 	return
	// }

	// sent request
	url := "https://webhook.site/a1ef5109-7e15-4ec8-9864-a48e4eb496d3"
	client := &http.Client{}
	req, err := http.NewRequest("POST", url, payload)

	if err != nil {
		fmt.Println("Error", err)
		jsonResponse(w, http.StatusText(http.StatusBadRequest), http.StatusBadRequest)
		return
	}
	req.Header.Set("Content-Type", writer.FormDataContentType())
	res, err := client.Do(req)
	if err != nil {
		fmt.Println("Error", err)
		jsonResponse(w, http.StatusText(http.StatusBadRequest), http.StatusBadRequest)
		return
	}
	defer res.Body.Close()

	fmt.Println(res)

	jsonResponse(w, http.StatusText(http.StatusCreated), http.StatusCreated)
}

